        <input
          type="note"
          //   onChange={(e) => inputKupon(e.target.value)}
          placeholder="Napomena(opcionalno)"
        />
      </label>
      <div className="buttons">
          <Button onClick={nazadHandler}>Nazad</Button>
         { <Button >Dalje</Button>}
        </div>
    </div>
  );
}

export default Kontakt;
